  Descendants of WILLIAMS, Henry and COLDHAM, Marianne
  JWILLIAMS, Edward Marsh and DAVIS, Jane
  JWILLIAMS, Allen Marsh and BUCHANAN, Annabelle Milne (Bella)
  JWILLIAMS, Muriel Buchanan and FAULKNER, Albert Joseph
  JFAULKNER, Ian Douglas Allen and CHEESEMAN, Margaret
  05> FAULKNER, Ian Douglas Allen m on 04.04.1942 to CHEESEMAN, Margaret
  b 16.10.1920
  b 21.03.1920
  Ian b, at Havelock North and m, in London, England. Margaret, d/o Albert Cheeseman and Edith Fedarb.
  Address: 17 Byron Street, Gisborne.
  Ian was educated at Hereworth School and Wanganui Collegiate School. He went to London in 1939 and
  attended the Chelsea College of Aero Engineering to qualify as an aero engineer. He joined the Fleet
  Air Arm a sub lieutenant and served in Scotland for 1 1/2 years and in India for 2 years. He returned
  to New Zealand after the war and farmed at "Waihina" until he retired in 1987.
  Margaret trained and worked as a typistl secretary.
  01> FAULKNER, Graham Eric m on 01.08.1970 to BUNYAN, Heather
  b 14.01.1947
  b 17.03.1948
  Graham b. and m, at Gisborne. Heather, d/o John and Lucy Bunyan, b, at Gisborne. Address: "Waihina"
  Station, Wharerata Road, RD 2, Gisborne.
  Graham was educated at Hereworth School and Wanganui Collegiate School then completed one year of
  an architectural course at Auckland University. He is now farming on "Waihina" station. He was
  Commissioner of Health with the Tairawhiti Area Health Board (1991-92) and Che Coard Director
  (1992-97). In 1989-95 he was president of the Gisborne Veterinary Club Council, and on the
  Executive Committee of the Federation of New Zealand Veterinary Clubs. In 1982 he was a Rotary GSE
  team member to Denmark, and in 1985 was a member of Kellogs Rural Leadership course at Lincoln
  University.
  Heather was educated at Gisborne Girls' High School.
  01> FAULKNER, Michael Eric
  b 04.05.1972
  Michael b. at Gisborne. He was educated at Hereworth School, Wanganui Collegiate School and
  Gisborne Boys' High School and in the 1st rugby XV.
  02> FAULKNER, Jeremy John m on 07.04.1996 to BEUTH, Heidi
  b 30.08.1974
  b ** ** ****
  Jeremy b. at Waipukurau. He was educated at Hereworth School, Wanganui Collegiate School and
  Gisborne Boys' High School and in the 1st rugby XV. He is now dairy farming in the Bay of
  Plenty.
  01> FAULKNER, Georgia Lucy Eve
  b 20.06.1998
  02>'FAULKNER, Rachel Jane
  b 20.05.1952
  Rachel b. at Auckland. Address: 96 Short Street, Brooklyn Mews, Hamilton.
  Rachel was educated at Friends' School and Woodford House and completed her nursing training at
  Waikato Hospital. She is now a district nurse in Hamilton,
  03> FAULKNER, Isabelle Margaret
  b 30.10.1956
  Isabelle b. at Gisborne.
  Isabelle was educated at the Rudolph Steiner school in Hastings and at Woodford House and trained
  as a secretary in Auckland. She is now living and working in Palmerston North.
  01> VANDERKOLK, Nicholas Ian
  b 25.10.1985
  Nicholas b. at Palmerston North.
